import React from 'react';
import "./Civic.css";
import { MapContainer, Marker, Popup, TileLayer, useMap } from 'react-leaflet'


const Civic = ({ geoJson = [] }) => {
  // const map = useMap();
  console.log(geoJson)
  const divStyle = {
    height: 400,
    width: 600
  };
  return (

    <MapContainer style={{ height: 400 }} center={[0, 0]} zoom={3} scrollWheelZoom={true}>
      <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution="&copy; OpenStreetMap contributors"
      />
      {geoJson.map((item) => {
        <Marker position={[item.geometry.Latitude, item.geometry.Longtitude]}>
        <Popup>
          A pretty CSS3 popup. <br /> Easily customizable.
        </Popup>
      </Marker>
      })}

    </MapContainer>
  )
}
export default Civic;
